def main():
    n = int(input())
    kids = [[] for i in range(n)]
    for i in range(n):
        a, b = [int(x) for x in input().split()]
        kids[i] = [a, b]
    # print(kids)

    # find the first kid
    for i in range(n):
        if kids[i][0] in kids[kids[i][1] - 1] and kids[i][1] in kids[kids[i][0] - 1]:
            first = i + 1
            break
    # print(first)

    # find the rest of the order
    order = [first]
    for i in range(n - 1):
        if kids[order[i] - 1][0] in kids[order[i] - 1]:
            order.append(kids[order[i] - 1][0])
        else:
            order.append(kids[order[i] - 1][1])
    # print(order)

    for i in range(n):
        print(order[i], end=' ')

